	(21, '531f3a6b-9e3b-4be6-9b96-75bc4a9963f4', NULL, 'banido devido ao uso constante de autoclick e a tentativa de invasao de contas. Estas acoes violam gravemente as regras do servidor e comprometem a integridade do jogo.', 'cb81baa9-8559-4784-bbdd-5bb3f46c1dea', 'xHelly', NULL, NULL, NULL, '2024-11-13 10:40:53', 1731494453029, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
