	(23, 'e9832617-8d1b-4c22-9b92-01e94747ae47', NULL, 'Devido a infracoes de difamacao e toxicidade, foi decidido em votacao por unanimidade da equipa de staff a aplicacao de banimento permanente a Rasputin77, sem possibilidade de apelo. Esta decisao e definitiva.', 'CONSOLE', 'Console', NULL, NULL, NULL, '2024-11-13 10:43:03', 1731494583027, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
	(24, '153469fd-8671-4b8a-b698-b11dd1b560b0', NULL, 'Conta recem-criada que, ao entrar no servidor, comecou imediatamente a usar hacks. Este comportamento viola as regras e demonstra intencao de manipular o jogo de forma injusta.', 'cb81baa9-8559-4784-bbdd-5bb3f46c1dea', 'xHelly', NULL, NULL, NULL, '2024-11-13 10:44:33', 1731494673279, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
