	(36, '9e167b00-f5dc-4c3f-b22d-ef4db1081d51', NULL, 'banido apos repetidos usos de autoclick e diversas tentativas de escapar das sancoes, usando varias contas para contornar as penalidades aplicadas. Demonstrou tambem cumplicidade em tentativas de duplicacao de itens e uso de hacks no servidor. Este comportamento representa uma violacao grave das regras e uma falta de respeito pela comunidade.', 'CONSOLE', 'Console', NULL, NULL, NULL, '2024-11-13 10:53:11', 1731495191675, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
	(38, '751c3574-7784-45b5-9b8a-23ad9b863344', '#', '.', 'CONSOLE', 'Console', NULL, NULL, NULL, '2024-11-13 10:54:27', 1731495267425, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
	(39, '0f29cdf8-4a9c-4768-870a-28f7e061c09a', NULL, 'Apos uma invasao de contas, o jogador recebeu uma segunda oportunidade com a condicao de nao voltar a quebrar as regras. No entanto, ignorou o aviso e iniciou insultos a todos os jogadores em chat aberto. Esse comportamento demonstra desrespeito pelas diretrizes do servidor e pela confianca que lhe foi dada.', 'CONSOLE', 'Console', 'CONSOLE', 'Console', '.', '2024-12-16 20:32:57', 1731495337975, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'0'),
	(40, 'c2d651a8-fe7d-4ee2-9d40-24f66db8ffd5', NULL, 'O jogador foi banido devido a comportamentos inconvenientes para os outros jogadores, desrespeito contínuo à comunidade e envolvimento em roubo de itens. Este tipo de conduta viola as regras do servidor e compromete a experiência de todos os participantes.', 'CONSOLE', 'Console', NULL, NULL, NULL, '2024-11-13 10:56:14', 1731495374575, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
	(41, '71755ee9-f7ae-440a-a722-38ee9c484b31', NULL, 'O jogador foi banido por desrespeito agressivo contra as mulheres, com comentarios e atitudes inaceitaveis no servidor. Este comportamento viola as normas de respeito e convivencia da comunidade, sendo uma violacao grave das regras.', 'CONSOLE', 'Console', NULL, NULL, NULL, '2024-11-13 10:57:22', 1731495441925, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
	(43, '3c2a8364-2b4a-3b39-b686-8ae3e45c77a3', '#', 'Banido devido a diversas infracoes, incluindo roubo, conduta toxica, ofensas a jogadores, griefing, uso de hacks e abuso de bugs. Apos dois anos, foi dada uma segunda oportunidade, mas o jogador continuou com comportamentos inapropriados, levando ao banimento definitivo.', 'CONSOLE', 'Console', NULL, NULL, NULL, '2024-11-13 10:58:28', 1731495508175, 0, 255, '*', 'litebans', b'0', b'0', b'0', b'1'),
